import code from '../../../assets/img/icons/landing/code.svg'
import pages from "../../../assets/img/icons/landing/pages.svg"
import draw from '../../../assets/img/icons/landing/draw.svg'
import interactions from '../../../assets/img/icons/landing/interactions.svg'
import responsive from '../../../assets/img/icons/landing/responsive.svg'
import updates from '../../../assets/img/icons/landing/updates.svg'
import support from '../../../assets/img/icons/landing/support.svg'
import plugin from '../../../assets/img/icons/landing/plugin.svg'
import docs from '../../../assets/img/icons/landing/docs.svg'
import modern from '../../../assets/img/icons/landing/modern.svg'
import elements from '../../../assets/img/icons/landing/elements.svg' 
import theming from '../../../assets/img/icons/landing/theming.svg'

export const iconFeatures = [
    [
        {
            src: code,
            title: 'Structured Code',
            span: 'For an optimized dev experience',
        },
        {
            src: pages,
            title: '43 Prebuilt Pages',
            span: 'To help you kickstart your project',
        }, {
            src: draw,
            title: 'Illustrations',
            span: 'Included as svg and png files',
        }], [
        {
            src: interactions,
            title: 'Micro Interactions',
            span: 'And attention to details',
        }, {
            src: responsive,
            title: 'Responsive Design',
            span: 'Mobile first UI framework',
        }, {
            src: updates,
            title: 'Lifetime Updates',
            span: 'With new content every time',
        }], [
        {
            src: modern,
            title: 'Modern Design',
            span: 'Following the latest app trends',
        }, {
            src: elements,
            title: '350+ UI Elements',
            span: 'Because we love our customers',
        }, {
            src: theming,
            title: 'Easy Theming',
            span: "Branding won't be a problem",
        }], [
        {
            src: support,
            title: 'Customer Support',
            span: "Via email and support forum",
        },
        {
            src: plugin,
            title: '1 Premium Plugin',
            span: 'Save $30 on the Fancybox 3 plugin',
        }, {
            src: docs,
            title: 'Detailed Documentation',
            span: 'To quickly get you started',
        }
    ]]
